  "topCompetitors": [
    "Competitor Name 1",
    "Competitor Name 2",
    "Competitor Name 3"
  ],
  "idealCustomerProfile": {
    "description": "A paragraph describing the ideal customer.",
    "department": "The relevant department for B2B customers, or null",
    "jobTitle": "The relevant job title for B2B customers, or null",
    "seniority": "The relevant seniority level for B2B customers, or null"
  },
  "relatedGoogleQuestions": [
    {
      "question": "What is an example of a related question?"
    }
  ]
}

parameters.jsCode:
const resultsByPrompt = {};
const initialAnalysis = items[0].json.initialAnalysis;
// Pega o domínio que "viajou" com os itens
const domain = items[0].json.domain;

for (const item of items) {
  const originalPrompt = item.json.promptQuestion;
  const response = item.json.promptResponse;
  const model = item.json.model;

  if (originalPrompt) {
    if (!resultsByPrompt[originalPrompt]) {
      resultsByPrompt[originalPrompt] = [];
    }
    resultsByPrompt[originalPrompt].push({
      model: model,
      response: response
    });
  }
}

// Retorna um único objeto com TUDO que os próximos agentes precisam
return [{
  json: {
    domain: domain, // <-- Domínio incluído aqui
    initialAnalysis: initialAnalysis,
    comparative_results: resultsByPrompt
  }
}];

