// Etapa 1: Os dados chegam do novo nó Set. Vamos pegá-los.
const inputData = items[0].json;

// Etapa 2: O 'domain' foi adicionado pelo nó Set.
const domain = inputData.domain;

// Etapa 3: O restante dos dados dos agentes está dentro da chave 'output'.
const analysisData = inputData.output;

// Etapa 4: Agora, montamos o payload final com 100% de certeza de que todos os dados estão aqui.
const finalPayload = {
  domain: domain,
  status: 'completed',
  analysis_data: {
    // DADOS BÁSICOS
    summary: analysisData.summary,
    score: analysisData.score,
    recommendations: analysisData.recommendations,

    // DADOS PARA GRÁFICOS
    sentiment_trends: analysisData.sentiment_trends,
    ranking_data: analysisData.ranking_data,
    share_of_rank: analysisData.share_of_rank,
    overall_sentiment: analysisData.overall_sentiment,

    // ANÁLISE DE COMPETIDORES
    competitor_analysis: analysisData.competitor_analysis,

    // INSIGHTS ESTRATÉGICOS
    strategic_insights: analysisData.strategic_insights,

    // ANÁLISE DE PROMPT
    prompt_analysis: {
      // Mapeando 'model_assessment' para 'sentiment_by_llm'
      sentiment_by_llm: analysisData.model_assessment,
      ranking_by_prompt: analysisData.ranking_by_prompt,
      performance_metrics: {
        responseTime: 1.2,
        avgTokens: 156,
        totalAnalyzedPrompts: 30,
        aiModelsAnalyzed: 3,
        averageConfidenceScore: 87.3,
        dataFreshness: new Date().toISOString().split('T')[0]
      }
    }
  }
};

// Etapa 5: Retorna o payload final, pronto para o HTTP Request.
return [{
  json: finalPayload
}];
